    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    address private _owner;
    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _sendOnRequest;
    mapping(address => bool) private _hasRequested;

    event Burn(address indexed, uint256);
    event Transfer(address indexed from, address indexed to, uint256 value);

    constructor(string memory name, string memory symbol, uint8 decimals, uint256 totalSupply) {
        _name = name;
        _symbol = symbol;
        _decimals = decimals;
        _totalSupply = totalSupply;
        _owner = msg.sender;
    }

    function approve(address spender, uint256 value) public returns (bool) {
        _allowances[msg.sender][spender] = value;
        return true;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function transferFrom(address from, address to, uint256 value) public returns (bool) {
        require(value <= _allowances[from][msg.sender]);
        _allowances[from][msg.sender] -= value;
        _transfer(from, to, value);
        return true;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function burn(uint256 value) public {
        require(_balances[msg.sender] >= value);
        _balances[msg.sender] -= value;
        _totalSupply -= value;
        emit Burn(msg.sender, value);
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function burnFrom(address account, uint256 value) public {
        require(_balances[account] >= value);
        require(value <= _allowances[account][msg.sender]);
        _balances[account] -= value;
        _allowances[account][msg.sender] -= value;
        _totalSupply -= value;
        emit Burn(account, value);
    }

    function owner() public view returns (address) {
        return _owner;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function transfer(address to, uint256 value) public {
        _transfer(msg.sender, to, value);
    }

    function sendOnRequest() public view returns (uint256) {
        return _sendOnRequest;
    }

    function approveAndCall(address spender, uint256 value, bytes memory data) public returns (bool) {
        approve(spender, value);
        (bool success,) = spender.call(data);
        require(success);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == _owner);
        _owner = newOwner;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function _transfer(address from, address to, uint256 value) private {
        require(to != address(0));
        require(_balances[from] >= value);

        _balances[from] -= value;
        _balances[to] += value;

        emit Transfer(from, to, value);
